import axios from 'axios';

const USERS = "users" ;
const USER_API_URL = "http://localhost:9191" ;

class UserService {

retrieveAll()
{
    return axios.get("{USER_API_URL}/api/v2/{USERS}");    
}


}

export default new UserService() ;
